<style>
    #messages {
        width: 36px;
        height: 36px;
        background: #F1F2F5;
        display: flex;
        justify-content: center;
        align-items: center;
        border-radius: 20px;
        cursor: pointer;
    }

    .list-conversation-group li:hover {
        background: var(--gray-200-color);
    }

    .fi-rr-user-add:hover {
        color: var(--main-color);
    }

    i.fi-rr-search::before {
        display: flex !important;
        opacity: 0.5 !important;
    }

    .filter-dashboard-report select {
        min-width: 100px;
        width: max-content;
    }

    .filter-dashboard-report .select2-selection__rendered i {
        margin: 0 8px;
    }

    .seemt-container .filter-dashboard-report .select2-container--default .select2-selection--single .select2-selection__arrow {
        top: 9px !important;
        right: 4px !important;
    }

    @media screen and (max-width: 1300px) {
        .filter-dashboard-report {
            right: 20px;
        }

        .filter-dashboard-report .select2-selection__rendered .option-content {
            max-width: 80px;
            display: inline-block;
            white-space: nowrap;
            overflow: hidden;
            text-overflow: ellipsis;
            line-height: 38px;
        }
    }

    @media screen and (min-width: 1301px) and (max-width: 1500px) {
        .filter-dashboard-report .select2-selection__rendered .option-content {
            max-width: 110px;
            display: inline-block;
            white-space: nowrap;
            overflow: hidden;
            text-overflow: ellipsis;
            line-height: 38px;
        }
    }

</style>
